package basics;

public class Break {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=10;i++) {
			System.out.println("chinna");
			for(int j=1;j<=5;j++) {
				System.out.println("pasam");
			}
				if(i<=3) {
					System.out.println("gajjaram");
					break;
				}
			}
		}

	
}

